#include <iostream>
#include <vector>
#include <algorithm>
#include <map>
#include <unordered_map>
#include <stack>
#include <queue>
#include <set>
#include <unordered_set>
#include <bitset>
#include <iomanip>
#include <climits>
#include <string>
#include <cstring>
#include <cmath>

using namespace std;

#define pb push_back
#define mp make_pair

typedef pair <int, int> pii;
typedef pair <int, pii> piii;
typedef unsigned long long ull;
typedef long long ll;
typedef pair <ll, ll> pll;

const int N_MAX = 51;
const int SUM_MAX = 2500000;

struct HASH{
	size_t operator()(const piii &x)const{
		return hash<long long>()(((long long)x.first)^(((long long)x.second.first)<<32)^(((long long)x.second.first)<<45));
	}
};


// top-left and bottom-right [(x1, y1), (x2, y2)]
// vector < vector < vector < vector <int> > > > dp1(N_MAX, vector < vector < vector <int> > > (N_MAX, vector < vector <int> > (N_MAX, vector <int> (N_MAX))));
vector < vector <int> > sum(N_MAX, vector <int> (N_MAX));
// top-right and bottom-left [(x1, y1), (x2, y2)]
// vector < vector <int> > dp2(N_MAX, vector <int> (N_MAX));
// vector < vector < vector < vector <int> > > > dp2(N_MAX, vector < vector < vector <int> > > (N_MAX, vector < vector <int> > (N_MAX, vector <int> (N_MAX))));

// top-left (x1, y1) bottom-right (x2, y2)
int getSum(int x1, int y1, int x2, int y2) {
	return (sum[x2][y2] - sum[x2][y1-1] - sum[x1-1][y2] + sum[x1-1][y1-1] + SUM_MAX);
}

int main() {
	int N;
	cin >> N;

	vector < vector <int> > plot(N+1, vector <int> (N+1));
	// unordered_map <piii, int, HASH> tl, bl, tr, br;
	for (int i = 1; i <= N; i++) for (int j = 1; j <= N; j++) cin >> plot[i][j];

	for (int i = 1; i <= N; i++) for (int j = 1; j <= N; j++) sum[i][j] = sum[i][j-1] + sum[i-1][j] - sum[i-1][j-1] + plot[i][j];

	// unordered_map <int, int> cnt;
	vector <int> cnt(2*SUM_MAX+1);
	int ans = 0;
	for (int i = 1; i <= N; i++) {
		for (int j = 1; j <= N; j++) {
			// cnt.clear();
			// top-left corner with bottom-right
			// top-left (k, l)
			// bottom-right (i, j)
			for (int k = 1; k < i; k++)
				for (int l = 1; l < j; l++)
					cnt[getSum(k, l, i-1, j-1)]++;

			// top-left (i, j)
			// bottom-right (k, l)
			for (int k = i; k <= N; k++)
				for (int l = j; l <= N; l++)
					ans += cnt[getSum(i, j, k, l)];

			for (int k = 1; k < i; k++)
				for (int l = 1; l < j; l++)
					cnt[getSum(k, l, i-1, j-1)]--;

			// cnt.clear();
			// bottom-left corner with top-right
			// bottom-left (k, l)
			// top-right (i, j)
			for (int k = i+1; k <= N; k++)
				for (int l = 1; l < j; l++)
					cnt[getSum(i+1, l, k, j-1)]++;

			// bottom-left (i, j)
			// top-right (k, l)
			for (int k = 1; k <= i; k++)
				for (int l = j; l <= N; l++)
					ans += cnt[getSum(k, j, i, l)];

			for (int k = i+1; k <= N; k++)
				for (int l = 1; l < j; l++)
					cnt[getSum(i+1, l, k, j-1)]--;
		}
	}

	cout << ans << "\n";

	return 0;
}

